import {StyleSheet, View, Text, FlatList} from 'react-native'
import React, {useEffect, useState} from 'react'
import axios from 'axios'

function RatesScreen() {
    const [ratesList, setRatesList] = useState([])

    useEffect(() => {
        axios.get('http://192.168.1.108:3000/api/rates/get')
            .then((response) => {
                console.log(response)
                setRatesList(response.data.data.rates)
            })
            .catch((error) => {
                console.log(error)
            })
    }, [])

    console.log(ratesList)

    return (
        <View style = {styles.container}>
            <Text style = {styles.h2text}>Rates List</Text>
            <FlatList
                data = {ratesList}
                renderItem = {({item}) => {
                    <View style={styles.flatview}>
                        <Text style={styles.name}>{item.repair_type}</Text>
                        <Text style={styles.email}>{item.rateOfRepair}</Text>
                    </View>
                }}
                keyExtractor = {item => item.repair_type}
            />
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        marginTop: 50,
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: '#F5FCFF',
      },
      h2text: {
        marginTop: 10,
        fontFamily: 'sans-serif',
        fontSize: 36,
        fontWeight: 'bold',
      },
      flatview: {
        justifyContent: 'center',
        paddingTop: 30,
        borderRadius: 2,
      },
      name: {
        fontFamily: 'Verdana',
        fontSize: 18
      },
      email: {
        color: 'red'
      }
})
export default RatesScreen;
